import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { GridList, GridListTile, GridListTileBar, ListSubheader, IconButton, Icon, Typography } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        overflow: 'hidden',
        backgroundColor: theme.palette.background.paper,
    },
    gridList: {
        width: '100%',
        height: 450,
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        overflow: 'hidden',
        // backgroundColor: theme.palette.background.paper,
        margin: '0 auto',
    },
    subheader: {
        textAlign: 'center',
        marginTop: '20px',
    },
    tile: {
        marginRight: '10px',
    },
    icon: {
        color: 'rgba(255, 255, 255, 0.54)',
    },
}));

const friendList = [
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Brody Banner',
    },
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Terri Banner',
    },
    {
        img: 'https://www.cambridgesciencefestival.org/wp-content/uploads/2019/03/maxresdefault.jpg',
        title: 'Stan Banner',
    },
]

function Friends() {

    const classes = useStyles();

    return (
        <div className="col-12">
                <GridList cellHeight={180} col={2.5} className={classes.gridList}>
                    <GridListTile key="Subheader" cols={2}>
                        <ListSubheader component="div">
                            <Typography variant="h4" className={classes.subheader}>Friends</Typography>
                        </ListSubheader>
                    </GridListTile>
                    {friendList.map((friend, index) => {
                        return (
                                <GridListTile cols={0.5} className={classes.tile} key={index} >
                                    <img src={friend.img} />
                                    <GridListTileBar 
                                        title={friend.title}
                                        actionIcon={
                                            <IconButton className={classes.icon}>
                                                <Icon>exit_to_app</Icon>
                                            </IconButton>
                                        }
                                    />
                                </GridListTile>
                        )
                    })}
                </GridList>
        </div>
    );
}

export default Friends;
